import React from 'react';
import styled from 'styled-components';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import TwitterIcon from '@mui/icons-material/Twitter';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import { createTheme } from '@mui/material/styles';


const Container = styled.div`
    display: flex;
`;

// Designing the left side of the container.. 
const Left = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    padding: 20px;
`;

const Logo = styled.h1``;

const Desc = styled.p`
    margin: 20px 0px;
`;

const SocialContainer = styled.div`
    display: flex;
`;

const SocialIcons = styled.div`
    color: black;
    width: 40px;
    height: 40px;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    margin-right: 20px;
    background-color: #${props=>props.color}
`;

const Center = styled.div`
    flex: 1;
`;

const Right = styled.div`
    flex: 1;
`;


export default function Footer() {
  return (

    <Container>
        {/* Designing the Left side of the Footer.. */}
        <Left>
            <Logo>CATE.</Logo>
            <Desc>Mollit eu laboris occaecat amet aliquip sunt. Duis do laboris est culpa irure. Velit est do consequat nostrud duis pariatur.</Desc>
            <SocialContainer>

                <SocialIcons color='DCF7EA'>
                    {/* <FacebookIcon /> */}
                    <a target="_blank" href="https://www.facebook.com/"><FacebookIcon /></a>
                </SocialIcons>

                <SocialIcons color='D4E3C5'>
                <a target="_blank" href="https://www.instagram.com/"><InstagramIcon /></a>
                </SocialIcons>

                <SocialIcons color='F5EDC9'>
                <a target="_blank" href="https://www.twitter.com/"><TwitterIcon /></a>
                </SocialIcons>

                <SocialIcons color='DFC7B3'>
                <a target="_blank" href="https://www.linkedin.com/"><LinkedInIcon color='seconary'/></a>
                </SocialIcons>

            </SocialContainer>
        </Left>

        {/* Designing the Center side of the Footer.. */}
        <Center></Center>

        {/* Designing the Right side of the Footer.. */}
        <Right></Right>
    </Container>

  )
}
